INSERT INTO `contact` VALUES (8, 'Eric Jones', 'eric@talkwithwebvisitor.com', 'Strike when the irons hot', 'Hey there, I just found your site, quick question\r\n\r\nMy names Eric, I found eventstack.id after doing a quick search  you showed up near the top of the rankings, so whatever youre doing for SEO, looks like its working well.\r\n\r\nSo heres my question  what happens AFTER someone lands on your site?  Anything?\r\n\r\nResearch tells us at least 70% of the people who find your site, after a quick once-over, they disappear forever.\r\n\r\nThat means that all the work and effort you put into getting them to show up, goes down the tubes.\r\n\r\nWhy would you want all that good work  and the great site youve built  go to waste?\r\n\r\nBecause the odds are theyll just skip over calling or even grabbing their phone, leaving you high and dry.\r\n\r\nBut heres a thought what if you could make it super-simple for someone to raise their hand, say, okay, lets talk without requiring them to even pull their cell phone from their pocket?\r\n  \r\nYou can  thanks to revolutionary new software that can literally make that first call happen NOW.\r\n\r\nTalk With Web Visitor is a software widget that sits on your site, ready and waiting to capture any visitors Name, Email address and Phone Number.  It lets you know IMMEDIATELY  so that you can talk to that lead while theyre still there at your site.\r\n  \r\nYou know, strike when the irons hot!\r\n\r\nCLICK HERE http://www.talkwithwebvisitors.com to try out a Live Demo with Talk With Web Visitor now to see exactly how it works.\r\n\r\nWhen targeting leads, you HAVE to act fast  the difference between contacting someone within 5 minutes versus 30 minutes later is huge  like 100 times better!\r\n\r\nThats why you should check out our new SMS Text With Lead feature as well once youve captured the phone number of the website visitor, you can automatically kick off a text message (SMS) conversation with them. \r\n \r\nImagine how powerful this could be  even if they dont take you up on your offer immediately, you can stay in touch with them using text messages to make new offers, provide links to great content, and build your credibility.\r\n\r\nJust this alone could be a game changer to make your website even more effective.\r\n\r\nStrike when  the irons hot!\r\n\r\nCLICK HERE http://www.talkwithwebvisitors.com to learn more about everything Talk With Web Visitor can do for your business  youll be amazed.\r\n\r\nThanks and keep up the great work!\r\n\r\nEric\r\nPS: Talk With Web Visitor offers a FREE 14 days trial  you could be converting up to 100x more leads immediately!   \r\nIt even includes International Long Distance Calling. \r\nStop wasting money chasing eyeballs that dont turn into paying customers. \r\nCLICK HERE http://www.talkwithwebvisitors.com to try Talk With Web Visitor now.\r\n\r\nIf you\'d like to unsubscribe click here http://talkwithwebvisitors.com/unsubscribe.aspx?d=eventstack.id\r\n', '2020-08-07 22:36:11');
